import React from "react";
import { Nav, Navbar, Button } from "react-bootstrap";
import * as moment from "moment";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faCalendarAlt } from "@fortawesome/free-solid-svg-icons";
import { Link } from "react-router-dom";

const TopNavigation = () => {
  const currentDate = moment().format("MMMM Do YYYY");

  return (
    <Navbar bg="light" expand="lg" className="fixed-top shadow flexible-navbar">
      {/* <Navbar.Brand href="#home" className="col-sm-3 col-md-2 mr-0">React-Bootstrap</Navbar.Brand> */}
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mr-auto">
          <Link to="/dashboard/404" className="ml-4 mt-2 text-secondary">Link</Link>
          <Link to="/dashboard/404" className="ml-4 mt-2 text-secondary">Link</Link>
          <NavDropdown title="Dropdown" id="basic-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
        </Nav>
        <Button
          href="#"
          variant="outline-info"
          disabled
          style={{ pointEvents: "none" }}
        >
          <FontAwesomeIcon icon={faCalendarAlt} className="mr-2" />
          {currentDate}
        </Button>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default TopNavigation;
